import { Container, Form, Card, Button } from 'react-bootstrap'
import React from 'react';
import { loginApi } from '../httpApi/UserApi';

const Auth = () => {

    const click = async () => {
        const response = await loginApi('root', '12345');
        console.log(response);
    }
    return (
        <Container>
            <Card>
                <h2>Авторизация</h2>
                <Form>
                    <Form.Control placeholder='Введите имя' />
                    <Form.Control placeholder='Введите парольl' />
                    <Button onClick={click}>Войти</Button>

                </Form>
            </Card>
        </Container>
    );
};

export default Auth;
